import{_ as p,c as o,o as r,ai as a}from"./chunks/framework.x8cKHNbC.js";const h=JSON.parse('{"title":"2023的碎语","description":"","frontmatter":{"title":"2023的碎语","prev":false,"next":false,"comment":false,"publish":false},"headers":[],"relativePath":"blog/cross/2023/index.md","filePath":"blog/cross/2023/index.md","lastUpdated":1737752633000}'),s={name:"blog/cross/2023/index.md"};function e(n,t,g,i,l,d){return r(),o("div",null,t[0]||(t[0]=[a('<h1 id="_2023的碎语" tabindex="-1">2023的碎语 <a class="header-anchor" href="#_2023的碎语" aria-label="Permalink to &quot;2023的碎语&quot;">​</a></h1><h2 id="_9月" tabindex="-1">9月 <a class="header-anchor" href="#_9月" aria-label="Permalink to &quot;9月&quot;">​</a></h2><p><strong>2023-09-25 20:17:58</strong></p><p>每次看到摩尔定律还是挺感慨的。</p><p><strong>2023-09-25 19:40:39</strong></p><p>忽然发现前面发动态是19号，现在已经是25号了，时间过的也太快了吧。</p><p><strong>2023-09-25 19:32:26</strong></p><p>找了一圈mathjax渲染公式显示的bug，然后发现是改了博客字体的原因，心累。</p><p><strong>2023-09-19 22:34:01</strong></p><p>从github转到gitlab，体验真的好了太多。</p><p><strong>2023-09-19 16:10:37</strong></p><p>我从未见过如CSDN这般厚颜无耻且没用的网站。</p><p><strong>2023-09-19 15:19:13</strong></p><p>这哪是在恢复博客备份，这分明是在练习使用git。</p><p><strong>2023-09-18 07:15:38</strong></p><p>只有当我专注于某件事时，我才能感觉到自己活着。</p><p><strong>2023-09-17 20:59:02</strong></p><p>他人即地狱。</p><p><strong>2023-09-14 06:46:46</strong></p><p>昨晚又只睡了一个小时，感觉迟早猝死（最好早点）。另外我大概是不会相信爱了，不是爱情，是爱。如果有一天我竟然又相信爱了，希望这条动态能把我打醒。</p><p><strong>2023-09-13 19:15:12</strong></p><p>兜兜转转又用回了Hexo，感觉我选择搭建博客的方案的心路历程都能写一篇博客出来了。</p><p><strong>2023-09-11 07:09:51</strong></p><p>生活不过是一场慢性死亡。而我是那个等死的傻逼。</p><h2 id="_7月" tabindex="-1">7月 <a class="header-anchor" href="#_7月" aria-label="Permalink to &quot;7月&quot;">​</a></h2><p><strong>2023-07-19 09:48:21</strong></p><p>用hugo重建了博客站点，虽然还没整完，差了很多，但是因为实在忍不了以前的站点访问速度了，所以决定先把这个半成品挂上去再说。</p><h2 id="_4月" tabindex="-1">4月 <a class="header-anchor" href="#_4月" aria-label="Permalink to &quot;4月&quot;">​</a></h2><p><strong>2023-04-20 05:31:27</strong></p><p>换了新CPU让我用电脑处理各种乱七八糟的东西没卡顿大概是我最近仅有的顺心的事情。</p><p><strong>2023-04-09 23:56:17</strong></p><p>我终于意识到我心态是真不行，这一天天的焦虑的睡不着觉。</p><p><strong>2023-04-08 21:58:53</strong></p><p>每次看到别人的博客就会觉得很好看，我也想整成那样的。是的，我又开始嫌弃现在的博客页面了。</p>',34)]))}const c=p(s,[["render",e]]);export{h as __pageData,c as default};
